import React, { useEffect } from "react";
import { connect } from "react-redux";
import { useHistory, useParams } from "react-router-dom";
import { setCashflow, setModal } from "../../reducers/navigationReducer";
import { editDashboard, getDashboard } from "../../reducers/dashboardReducer";
import CalculatorFormTooltip from "../CalculatorForms/CalculatorFormTooltip";
import {
  cumulativeChartParse,
  annualChartParse,
  tableParse,
  developerCalculation,
  developerMOCCalculation,
  fundingChartParse,
} from "../../helpers/developerDashboardHelper";
import {
  currencyFormatter,
  percentageFormatter,
  IRRCalculation,
} from "../../helpers/dashboardHelper";
import { Line, Bar } from "react-chartjs-2";
import { Table, Card, ListGroup, Button, Spinner } from "react-bootstrap";
import "../styles/Dashboard.css";

const DeveloperDashboard = (props) => {
  const id = useParams().id;
  const history = useHistory();
  let rawData;
  let annualChart;
  let cumulativeChart;
  let tableData;
  let fundingChart;

  useEffect(() => {
    if (id) {
      props.getDashboard(id);
    }
  }, [id]);

  const handleSave = (e) => {
    e.preventDefault();
    props.setModal("saveDashboard");
  };

  const handleEdit = (e) => {
    e.preventDefault();
    if (id) {
      history.push(`/developer/edit/${id}`);
    } else {
      // TO DO - EDIT DASHBOARD IF NOT SAVED
      // props.editDashboard();
    }
  };

  if (props.values.isFetching || !props.values.data[0]) {
    return (
      <div className="dashboard-spinner-container">
        <Spinner
          className="loading-spinner"
          animation="border"
          variant="primary"
        />
      </div>
    );
  } else {
    rawData = developerCalculation(props.values.data[0]);
    annualChart = annualChartParse(rawData);
    cumulativeChart = cumulativeChartParse(rawData);
    tableData = tableParse(rawData);
    fundingChart = fundingChartParse(rawData);
    return (
      <section className="dashboard-section">
        <div className="dashboard-header">
          <h1>
            <b>Developer Dashboard</b>
          </h1>
          <Button
            id="dashboard-button"
            className="dashboard-save-button"
            onClick={handleSave}
            variant="primary"
